import React from "react";
import { NavLink } from "react-router-dom";

const MenuBar = () => (
  <ul className="navbar-menu">
    <li>
      <NavLink className="navbar-item" exact to="/">
        Home
      </NavLink>
      <NavLink className="navbar-item" exact to="/">
        Home
      </NavLink>
      <NavLink className="navbar-item" exact to="/">
        Home
      </NavLink>
    </li>
  </ul>
);

export default MenuBar;
